from fastai.vision import *
import base64
from .settings import INDEX_PATH, LEARNER_PATH, MODEL_FILE_NAME, IMAGE_IDS_FN, IMAGE_INFO_FN, FEATURE_MODEL
from .feature_extractor import FeatureExtractor
from .faiss_index import ImageSearchEngine, load_npy_file, load_invert_indexed


def test_extractor_and_search():
    index_path = INDEX_PATH
    image_index2info = load_invert_indexed(image_ids_fn=IMAGE_IDS_FN, image_info_fn=IMAGE_INFO_FN)

    if not os.path.exists(index_path):
        features = load_npy_file(FEATURE_MODEL)
        path = None
    else:
        features = None
        path = index_path

    search_engine = ImageSearchEngine(
        path=path,
        features=features,
        image_index2info=image_index2info,
        train=True,
    )

    if not os.path.exists(index_path):
        search_engine.save_index(index_path)

    # load feature extractor
    learner = load_learner(path=LEARNER_PATH, file=MODEL_FILE_NAME)
    feature_extractor = FeatureExtractor(learner)

    # with open('test_img.jpg', mode='rb') as img_f:
    #     img = img_f.read()
    #     img = base64.b64encode(img)

    img = "data:image/jpeg;base64,"

    image_feature = feature_extractor.extract_feature(img, base_64=True)
    results = search_engine.search(image_feature[None], num_results=10)
    print(results)

if __name__=="__main__":
    test_extractor_and_search()
